import React, { useEffect, useState } from "react";
import "./admin.css"
import axios from 'axios';





const Admin = () => {

    const [data,setdata] = useState([]);

    useEffect(()=>{
        axios.get("http://localhost:1000/servicebookget").then(function(response){
            setdata(response.data.data)
        })
    })

    return(
        <>
        <div className="admin-outer">
            <div className="admin-inner">
                <div className="admin-inner-child">
                    <ul>
                        <li>inquires</li>
                        <li>book services</li>
                        <li>plan book</li>
                    </ul>
                </div>
                <div className="admin-inner-child">
                    <div className="inquires">
                        <table>
                            <tr>
                                <td>id</td>
                                <td>name</td>
                                <td>email</td>
                                <td>number</td>
                                <td><button>detail</button></td>
                            </tr>
                            {
                                data.map((e)=>{
                                    return(
                                        <>
                                            <tr>
                                                <td>{e.id}</td>
                                                <td>{e.name}</td>
                                                <td>{e.email}</td>
                                                <td>{e.number}</td>
                                                <td><button>
                                                    details</button></td>
                                            </tr>
                                        </>
                                    )
                                })
                            }
                        </table>
                    </div>
                </div>
            </div>
        </div>
        </>
    )
}



export default Admin;
